import React from "react";
import "../styles/login.css";
import image from "../assets/login-image.jpg";

export const Login = () => {
  return (
    <div className="login-container">
      <div className="login"></div>
      <div className="login-image">
        <img src={image} alt="" />
      </div>
    </div>
  );
};
